// basisanimatie
function barAnimatie(){ 
	TweenMax.to(".leaflet-control-zoom", .25, {
		opacity: 0,
		delay: .25, 
		ease: Expo.easeOut
	});
	TweenMax.to(".overlay-bar", 1, {
		delay: .5, 
		height: wh,
		ease: Expo.easeOut
	});
	// Close
	TweenMax.to(".close", 1, {
		display: "block",
		delay: .5
	});
	TweenMax.to("#close-icon", 1.5, {
		marginTop: 20,
		opacity: 1,
		delay: .5,
		ease: Expo.easeOut
	});
};

function iconDisappear(type){
	var speed = .25;
	var properties = {
		delay: .5,
		opacity: 0,
	};
	if (type == "story") {
		TweenMax.to(".minardmode-icon", speed, properties)	
	} else {
		TweenMax.to(".storymode-icon", speed, properties)	
	}
};

function tagHover(type){
	var typeTag = "." + type + "mode-tag";
	var textTag = "." + type + "mode-text";
	console.log(typeTag);

	hoverAnim = new TimelineMax();

	hoverAnim.to(typeTag, .5, {
		opacity: 1,
		display: 'inline-block',
		ease: Expo.easeOut
	})
		.to(textTag, .5, {
		opacity: 1,
		display: 'inline-block',
		ease: Expo.easeOut
	})
};

function minardInit(){
	TweenMax.to("#minard", 1, {
		delay: 1,
		opacity: 1,
		display: "block",
	})
	TweenMax.from(".tabs-anim", .5, {
		delay: 1,
		marginTop: -30,
		ease: Expo.easeOut
	})
	TweenMax.to(".cargo-supercontainer", 1, {
		delay: 1,
		width: '100%',
		ease: Expo.easeOut
	})
};

//	Story
storyMode.addEventListener("click", function(){
	barAnimatie();
	iconDisappear("story");
}, false);
storyMode.addEventListener("mouseover", function(){
	tagHover("story")
}, false);
storyMode.addEventListener("mouseout", function(){
	hoverAnim.reverse();
}, false);

