function genCargo(innerContext){
	while (cargoContainer.firstChild) {
	    cargoContainer.removeChild(cargoContainer.firstChild);
	}

	this.context = innerContext; 
	this.rows=[];
	var step = 5;
	var lengte = context.length;
	step = lengte / 4;

	for (var iterator = 0; iterator < lengte ; iterator+=step){
		this.rows.push({"producten":this.context.slice(iterator,iterator+step)});
	};

	var source   = document.querySelector("#entry-template").innerHTML;
	var template = Handlebars.compile(source);

	var compiledHTML = template(rows);

	console.log(compiledHTML);

	var productsContainer = document.querySelector(".cargo-container");
	productsContainer.insertAdjacentHTML('afterbegin', compiledHTML);


};

var ajax = new XMLHttpRequest(); 

var minardCB = function () {
    if (ajax.readyState !== 4 || ajax.status !== 200) {
      return;
    }
    context = JSON.parse(ajax.responseText);

    // console.log(context);
    genCargo.bind(this, context);
    // genCargo(context);

    // console.log(genCargo(context));
};

function minardCall(letter) {
	var cargoLetter = "data/json/minardgui/" + letter + ".json";
	ajax.open('GET', cargoLetter, true);
	ajax.onreadystatechange = minardCB;
	ajax.send();
};

